INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(8, 'Omlet z kurczakiem i brokułami', 'sniadanie', 'Omlet to szczególna forma podania jajka, miła odmiana dla jajecznicy czy jajka na miękko.', , 'Rozbij jaja i rozmieszaj je na jednolitą masę.\r\nUmyj kurczaka, pokrój go w paski. Następnie przesmaż na oliwie z oliwek.\r\nPodziel brokuł na małe różyczki i ugotuj w osolonej wodzie.\r\nRozpuść masło na rozgrzanej patelni, po czym wlej jaja, dodaj kurczaka oraz brokuły. Należy uważać, aby masło nie przypaliło się, inaczej potrawa będzie niezdrowa i niesmaczna. Smaż całość do momentu, kiedy jaja zaczną się ścinać.\r\nPosyp omlet z wierzchu Przyprawą do kurczaka Knorr i podawaj.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(9, 'Amerykańskie naleśniki (pancakes)', 'sniadanie', 'Pancakes lub jak kto woli – pankejksy, czyli naleśniki amerykańskie, szturmem wdarły się na polskie stoły', , 'Jaja, mąkę, roztopione masło, proszek do pieczenia, cukier i mleko wymieszaj dokładnie odstaw na kilkanaście minut. Następnie na patelni rozgrzej odpowiednią porcję oleju z masłem i smaż małe, okrągłe placuszki o średnicy 10 centymetrów. Przewracaj placki na drugą stronę tak, aby były złoto- brązowe. Możesz przykryć patelnię i smażyć powoli przez 10 minut. Gotowe placki podawaj posypane cynamonem i polane syropem klonowym. Możesz również użyć ulubionych dodatków.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(10, 'Włoskie panini z szynką i serem', 'sniadanie', 'Włosi, słyną z pizzy i pasty, ale są także mistrzami kanapek. Domowe panini łatwo przygotujesz we własnej kuchni', , 'Oliwę wlej do kielicha miksera. Dodaj również suszone pomidory, bazylię i kostkę Knorr. Całość zmiksuj na gęstą pastę. Chleb przekrój wzdłuż na pół. Obie części posmaruj pastą z kostki Knorr. Pomidora oraz oliwki pokrój w plasterki. Na kromkę pieczywa połóż dwa plastry sera, plaster szynki, pomidora oraz oliwki. Przykryj drugą kromką. Gotowe panini połóż na grillu, przyłóż czymś ciężkim (na przykład garnkiem z wodą) i grilluj z obu stron, aby chleb zrobił się chrupiący i ser wewnątrz dobrze się rozpuścił. Rukolę wymieszaj z oliwą. Gotowe panini przekrój na pół i podawaj z sałatką.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(11, 'Jajecznica z brokułami', 'sniadanie', 'Lubisz urozmaicać przepisy na popularne dania? Spróbuj jajecznicy z brokułami. To śniadanie mistrzów', , 'Umyte różyczki brokuł gotuj 3-4 minuty we wrzącej wodzie. Jajka wymieszaj z serkiem topionym, dopraw pieprzem. Masę jajeczną dopraw pieprzem i przyprawą Knorr. Półplasterki cebuli zeszklij na oliwie. Dodaj masę jajeczną i brokuły. Smaż cały czas mieszając, aż jaja się zetną.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(12, 'Meksykańska jajecznica', 'sniadanie', 'W zaledwie 15 minut przygotujesz śniadanie, które pozytywnie nastroi Cię na resztę dnia! ', , 'Dymkę pokrój w małe plasterki, paprykę oraz pomidory umyj i również pokrój w kostkę. Dymkę oraz paprykę podsmaż na oliwie. Dodaj przyprawę Knorr i smaż jeszcze 1 minutę. Teraz dodaj pomidory oraz odcedzoną fasolkę. Całość duś ok 5 minut. Na oddzielnej patelni rozpuść masło. Jajka rozkłóć i usmaż klasyczną jajecznicę. Podawaj z warzywami.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(13, 'Duszona karkówka w sosie własnym z cebulą', 'obiad', 'Karkówka jest to ceniona część mięsa wieprzowego, wołowego czy baraniny, którą możemy zarówno ugotować, upiec lub usmażyć', , 'Mięso opłucz i pokrój na kotlety grubości 2 cm. Każdy rozbij lekko tłuczkiem, posyp pieprzem i oprósz mąką. W następnej kolejności obsmaż je z obu stron na złoty kolor na rozgrzanym oleju. Cebule pokrój w piórka i przesmaż w garnku na rozgrzanym oleju, dodaj majeranek, liść laurowy oraz ziele. Gdy cebula nabierze złotego koloru, wsyp pozostałą mąkę i przesmaż razem. Następnie dodaj 1 l wrzącej wody. Włóż mięso, Sos do pieczeni z cebulką Knorr i duś na małym ogniu do momentu, gdy karkówka będzie miękka. Podawaj z ziemniakami lub kaszą.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(14, 'Gyros w picie', 'obiad', 'Zapnijcie pasy, ponieważ będzie nie tylko smacznie, ale też międzynarodowo!', , 'Wytrybuj kości z kurczaka, oprósz je obficie przyprawą do girosa upiecz w nagrzanym do 190*C przez około 50 minut po tym czasie mięso pokrój w paseczki. W misce połącz drożdże z ciepła wodą a następnie połącz je z mąką oliwą i czarnuszką, wyrób ciasto zagniatając je przez około 7 minut . Odstaw je pod przykryciem na 60 minut w ciepłe miejsce do wyrośnięcia. Po tym czasie ciasto przełóż na stolnice podsypaną mąką. Wyrób ciasto jeszcze raz zagniatając je kilka razy, a następnie podziel na mniejsze porcje. Uformuj z nich kule. Kule podsypując mąką rozwałkuj na placki o średnicy około 20 cm, odstaw je pod przykryciem ze ściereczki na 10 minut, po czym placki smaż na rozgrzanej patelni (bez tłuszczu) przez około 40 sekund z każdej strony. Mogą się lekko przypiec. Majonez wymieszaj z jogurtem, posiekaną kolendrą oraz roztartym na miazgę czosnkiem, pastą z chili , kminem rzymskim dopraw do smaku kilkoma kroplami soku z cytryny, oraz jeśli uznasz to za konieczne, szczyptą soli. Pomidory cebulę i sałatę pokrój w cienkie plastry wymieszaj z Przyprawą Za\'atar Knorr. Ciepłe kawałki mięsa nałóż na placek, dodaj sałatkę i polej obficie sosem.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(15, 'Makaron w sosie pieczarkowym', 'obiad', 'Pyszny i tani pomysł na obiad', , 'Posiekaj cebulę w kostkę. Pokrój kurczaka w paski, a grzyby w plasterki. Ugotuj makaron wg wskazówek na opakowaniu. Wymieszaj Fix Knorr z mlekiem i musztardą. Usmaż grzyby na 1 łyżce oleju. Odłóż na talerz, a następnie usmaż osobno cebulę. Dodaj kurczaka i przesmaż na złoto. Przełóż grzyby na patelnię. Całość połącz z sosem. Gotuj przez 5 min. aż lekko zgęstnieje. Podawaj makaron posypany posiekaną natką pietruszki.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(16, 'Ziemniaczana zapiekanka z kurczakiem', 'obiad', 'Nie trzeba stać przy garach pół dnia, żeby przygotować coś pysznego i oryginalnego.', , 'Cebulę pokrój w piórka, podsmaż ją w garnku, dodaj pokrojonego w kostkę kurczaka, smaż chwilę, dodaj pokrojone w plastry ziemniaki. Całość smaż mieszając co jakiś czas, aż ziemniaki delikatnie się rozkleją. Dodaj wtedy śmietanę wymieszaną z fixem, całość zagotuj, a następnie przełóż w żaroodporne naczynie uciskając wszystkie składniki razem. Zapiekankę z wierzchu posyp serem, zawiń w folię aluminiową, wstaw do nagrzanego do 190°C piekarnika na 40 minut. Dziesięć minut przed końcem pieczenia usuń folię, aby ser mógł się zapiec. Podawaj z posiekaną natką pietruszki.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(17, 'Kotlety mielone z pieczarkami i żółtym serem', 'obiad', 'Kotlety mielone to sprawdzone i bardzo popularne danie obiadowe, które stało się już klasykiem kulinarnym', , 'Kajzerkę namocz w mleku, natkę posiekaj. Mięso przełóż do miski i połącz z odciśniętą kajzerką oraz jajkiem. Dopraw Przyprawą do mięsa mielonego Knorr dla podkreślenia smaku i wyrób jednolitą masę. Pieczarki oraz ser zetrzyj na tarce o grubych oczkach. Na patelni rozgrzej łyżkę oleju i przesmaż starte pieczarki. Dopraw do smaku pieprzem, wystudź, a następnie dodaj starty ser, pietruszkę, 1 łyżkę tartej bułki i wymieszaj. Mięso podziel na cztery części, na każdą z nich nałóż porcję pieczarek. Farsz oklej dokładnie mięsem i uformuj kotlety. Kotlety obtocz w bułce tartej i smaż na rozgrzanym tłuszczu na złoty kolor po 6-8 minut z każdej strony, w zależności od wielkości. Podawaj na ciepło.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(18, 'Parówki w cieście francuskim z warzywami', 'kolacja', 'Parówki w cieście francuskim to świetny sposób na prostą i jednocześnie efektowną przekąskę', , 'Ciasto francuskie pokrój na 8 jednakowych pasków. Cukinię oraz pieczarki umyj i pokrój w cienkie paski, a paprykę w cienkie piórka. Na każdy kawałek ciasta wyłóż plasterki pieczarek oraz cukinii. Posyp je pokruszoną mini kostką Knorr, a następnie połóż paprykę i plasterek sera. Parówki połóż na wierzchu tak, aby wystawały za ciasto i zawiń. Na blachę do pieczenia wyłóż papier pergaminowy i przełóż roladki. Posmaruj je roztrzepanym jajkiem i piecz w piekarniku w 180 °C przez 20 minut. Takie danie doskonale smakuje jako letnia przekąska na świeżym powietrzu.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(19, 'Gulasz z fasolką szparagową i warzywami', 'kolacja', 'Szukasz pomysłu na pyszne, szybkie danie, chcąc nieco odmienić monotonne menu obiadowe?', , 'Pokrój mięso w kostkę, Posiekaj cebulę w drobną kostkę. Oczyść papryki i pokrój na kawałki. Obierz i pokrój marchewki na plasterki. Odetnij końcówki i pokrój fasolkę na pół. Przesmaż mięso na patelni z 1 łyżką oleju równomiernie, na brązowo. Odłóż na talerz. Dodaj 2 łyżki oleju i smaż warzywa, mieszając przez ok. 5 minut na średnim ogniu. Dodaj 300 ml wody i zawartość opakowania Naturalnie smaczne Gulasz Knorr. Wymieszaj, doprowadź do wrzenia, zmniejsz ogień i gotuj pod przykryciem na niewielkim ogniu przez ok. 45 minut lub dłużej, aż do momentu gdy mięso będzie miękkie. Dodaj wody jeżeli potrzeba. Podawaj z natką pietruszki.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(20, 'Kotlety mielone wellington z warzywami', 'kolacja', 'Jeśli szukasz alternatywy dla klasycznych kotletów mielonych, wypróbuj przepis na kotlety mielone welington', , 'Bułkę zalej mlekiem poczekaj aż nasiąknie. Następnie bułkę odciśnij ją i połącz z surowym jajkiem i mięsem. Całość wymieszaj z przyprawą Knorr, która nada ona potrawie odpowiedniego smaku, a także ujednolici konsystencję pieczeni. Po doprawieniu mięsa zroluj je w dwa długie walce o średnicy około 3 cm. W garnku na rozgrzanej oliwie podsmaż pokrojona w kosteczkę cebulę, dodaj odciśnięty szpinak, pokrojone w paseczki suszone pomidory. Całość dopraw do smaku ostrą papryką i gałką muszkatową. Gdy szpinak nieco przestygnie dodaj do niego pokrojona w kostkę fetę. Na stolnicy oprószonej mąką rozwałkuj ciasto francuskie do grubości około 5 mm uformuj z niego prostokąt o długości około 20 cm i szerokości około 15 cm. Na cieście ułóż pierwszy walec mięsa a następnie na jego wierzch nałóż szpinak Całość przykryj drugą roladą z mięsa. Wszystko razem zawiń w ciasto francuskie posmarowane jajkiem. Roladę ponakłuwaj z wierzchu widelcem i posmaruj resztą jajka.  Tak przygotowaną roladę ułóż na pergaminie na blasze do pieczenia. Wstaw do nagrzanego do 200°C piekarnika na 25 minut. Po tym czasie sprawdź, czy mięso się upiekło. Jeśli twoja rolada jest nieco grubsza, odpowiednio wydłuż czas pieczenia.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(21, 'Makaron z kurczakiem i pieczarkami', 'kolacja', 'Szukasz pomysłu na szybki domowy obiad? Makaron z kurczakiem i pieczarkami spełni twoje oczekiwania', , 'Ugotuj makaron na sposób al dente w dużej ilości wody. Pokrój mięso i cebulę w kostkę, pieczarki w ćwiartki. Rozgrzej olej w średniej wielkości garnku i zeszklij na nim cebulę. Następnie dodaj mięso oraz pieczarki i wszystko razem podsmaż dokładnie, doprawiając odrobiną przyprawy Knorr. Zalej całość śmietaną i połącz z makaronem, po czym wymieszaj. Dopraw na koniec kilkoma kroplami soku z cytryny. Serwuj makaron posypany serem.', 3);
INSERT INTO `recipes` (`id`, `nazwa`, `kategoria`, `opis`, `zdjecie`, `przygotowanie`, `id_user`) VALUES
(22, 'Naleśniki z szynką i pieczarkami', 'kolacja', 'Jeżeli lubisz szynkę, ale znudziło ci się już jedzenie kanapek z wędliną na śniadanie lub kolację', , 'Za pomocą blendera zmiksuj mleko z jajkami i miękką margaryną. Następnie połącz z mąką do uzyskania jednolitej masy. Nalewaj porcje ciasta na rozgrzaną patelnię z olejem. Smaż naleśniki z obu stron. Na patelni z rozgrzaną margaryną zeszklij drobno posiekaną cebulę. Następnie dodaj pieczarki pokrojone w cienkie plastry. Gdy będą one miękkie, dodaj szynkę pokrojoną w paski. Smaż przez chwilę. Farsz dopraw przyprawą Knorr. Zawijaj pieczarkowo-szynkowe nadzienie w naleśnik i podawaj. Tak przygotowane naleśniki możesz również posypać serem i zapiec.', 3);
